import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router);
export default new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: "/axios1",
      name: "axios1",
      meta: { title: "Consumiendo datos por axios" },
      component: () => import("@/views/datosAxios/pruebaAxios1.vue"),
    },
  ]
});
